import React from 'react';
import { AuthContext } from '../../App';

const {isAuth} = useContext(AuthContext)

const Private = () => {
    if (isAuth === false) {
        return (
            <div className='testDiv'>NOT AUTAH</div>
        )
    }
    return (
        <div className='testDiv'>AUTHORISED</div>
    )
}


export default Private;
